function FormOfNotice() {
  return (
    <table>
      <thead>
        <tr>
          <th>NO</th>
          <th>제목</th>
          <th>날짜</th>
          <th>조회수</th>
        </tr>
      </thead>
    </table>
  );
}
export default FormOfNotice;
